import React from 'react'
import {Link} from 'react-router-dom'

const SingleHistory = ({history, index}) => {
  return (
    <tr>
      <td>{index + 1}</td>
      <td><Link><h5>{history.title}</h5></Link></td>
    </tr>
  )
}

export default SingleHistory
